import { Component } from 'react';

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      users:[]
    }
  }

  API_URL = "http://localhost:5281/";

  componentDidMount(){
    this.refreshUsers;
  }

  async refreshUsers() {
    fetch(this.API_URL + "api/todoapp/GetNotes").then(response => response.json())
    .then(data => {
      this.setState({users:data});
    })
  }

  render() {
    const{ users } = this.state;

